<section id="card-employee">
    <div class="card-wrapper">
        <div class="card">
            <div class="row-emp-3">
                <span class="title-card">Информация о сотруднике</span>
                <button type="button" class="close-btn">
                    <svg class="btn-svg svg-close" width="15" height="15" fill="none"
                         xmlns="http://www.w3.org/2000/svg">
                        <rect x="0.656738" y="2.07104" width="2" height="18" transform="rotate(-45 0.656738 2.07104)"
                              fill="white"/>
                        <rect x="2.07104" y="14.799" width="2" height="18" transform="rotate(-135 2.07104 14.799)"
                              fill="white"/>
                    </svg>
                </button>
            </div>
            <a class="back-to-results">←Назад к результатам</a>
            <div class="employee">
                <div class="row-emp-1">
                    <div class="card-fio">
                        <span class="fio last-name"></span>
                        <span class="fio first-name"></span>
                        <span class="fio middle-name"></span>
                    </div>
                    <div class="card-img">
                        <img class="avatar-emp">
                    </div>
                </div>

                <div class="row-emp-2">
                    <div class="unchanged-emp">
                        <span class="unchange-stroke">Направление</span>
                        <span class="unchange-stroke">Команда</span>
                        <span class="unchange-stroke">Должность</span>
                        <span class="unchange-stroke">Почта</span>
                        <span class="unchange-stroke">Телефон</span>
                        <span class="unchange-stroke">Этаж</span>
                    </div>

                    <div class="changed-emp">
                        <span class="change-stroke direction"></span>
                        <span class="change-stroke team"></span>
                        <span class="change-stroke position-emp"></span>
                        <span class="change-stroke mail"></span>
                        <span class="change-stroke phone"></span>
                        <span class="change-stroke floor-emp"></span>
                    </div>
                </div>
            </div>
        </div>
    </div>
</section>

<section id="card-with-free-table">
    <div class="card-wrapper">
        <div class="card-no-emp">
            <div class="btn-flex-end">
                <button type="button" class="close-btn-no-emp">
                    <svg class="btn-svg svg-close" width="15" height="15" fill="none"
                         xmlns="http://www.w3.org/2000/svg">
                        <rect x="0.656738" y="2.07104" width="2" height="18" transform="rotate(-45 0.656738 2.07104)"
                              fill="white"/>
                        <rect x="2.07104" y="14.799" width="2" height="18" transform="rotate(-135 2.07104 14.799)"
                              fill="white"/>
                    </svg>
                </button>
            </div>
            <div class="title-free-table">Выбранный стол<br>не занят сотрудником</div>
        </div>
    </div>
</section>

<section id="card-of-results">
    <div class="results-wrapper" data-scrollbar="true">
        <div class="results" >
            <!-- Результаты генерируются автоматически при нажатии на searchButton -->
        </div>
    </div>
</section>

<section id="card-of-no-results">
        <div class="no-results">
            <div class="btn-flex-end">
                <button type="button" class="close-btn-no-results">
                    <svg class="btn-svg svg-close" width="15" height="15" fill="none"
                         xmlns="http://www.w3.org/2000/svg">
                        <rect x="0.656738" y="2.07104" width="2" height="18" transform="rotate(-45 0.656738 2.07104)"
                              fill="white"/>
                        <rect x="2.07104" y="14.799" width="2" height="18" transform="rotate(-135 2.07104 14.799)"
                              fill="white"/>
                    </svg>
                </button>
            </div>
            <div class="title-no-results">Ваш запрос<br> не дал результатов</div>
            <img class="img-no-results" src="images/sad.png">

</section>
